import React from 'react';

import { withStyles } from '@material-ui/styles'; // jss library
import {Typography} from '@material-ui/core';
import {Link} from 'react-router-dom';
import ExternalLink from '../../../ExternalLink';

import img1 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/1.jpg';
import img2 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/2.jpg';
import img3 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/3.jpg';
import img4 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/4.jpg';
import img5 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/5.jpg';
import img6 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/6.jpg';
import img7 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/7.jpg';
import img8 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/8.jpg';
import img9 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/9.jpg';
import img10 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/10.jpg';
import img11 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/11.jpg';
import img12 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/12.jpg';
import img13 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/13.jpg';
import img14 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/14.jpg';
import img15 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/15.jpg';
import img16 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/16.jpg';

const jssStyle = theme => ({
    img: {
      display: 'block',
      marginLeft: 'auto',
      marginRight: 'auto',
      marginBottom: '30px',
      marginTop: '30px',
      maxWidth: '90%'
    },
    blockQuote: {
      background: '#f9f9f9',
      borderLeft: '10px solid #ccc',
      margin: '1.5em 10px !important',
      padding: '0.5em 10px',
      display: 'block',
      quotes: `'"''"''"''"'`,
      '&::before': {
        color: '#ccc',
        content: 'open-quote',
        fontSize: '4em',
        lineHeight: '0.1em',
        marginRight: '0.25em',
        verticalAlign: '-0.4em'
      }
    },
    center: {
        textAlign: 'center'
    }
})

const ImprovingYourAppTodaysTopEarningAppCharacteristics = (props) => {
  const {classes} = props;
  return (
    <div>
        <Typography variant="h4" gutterBottom>Apple App Store</Typography>
        <img src={img1} className={classes.img} alt='Top grossing iPhone apps'/>
        <Typography className={classes.center}><strong>NOTE: </strong>Underlined titles signify an app that shares a top spot across both major app stores.</Typography>
        <Typography variant="h6" gutterBottom>Gaming:</Typography>
        <Typography paragraph>Mobile Strike</Typography>
        <Typography paragraph>Clash of Clans</Typography>
        <Typography paragraph>Game of War - Fire Age</Typography>
        <Typography paragraph><u>Candy Crush Saga Clash Royale</u></Typography>
        <Typography variant="h6" gutterBottom>Entertainment:</Typography>
        <Typography paragraph><u>HBO NOW</u></Typography>
        <Typography paragraph><u>Netflix</u></Typography>
        <Typography variant="h6" gutterBottom>Music:</Typography>
        <Typography paragraph>Spotify Music</Typography>
        <Typography paragraph>Tidal</Typography>
        <Typography paragraph><u>Pandora - Free Music & Radio</u></Typography>
        <Typography variant="h4" gutterBottom>Google Play Store</Typography>
        <Typography variant="h6" gutterBottom>Gaming:</Typography>
        <Typography variant="h6" gutterBottom>Entertainment:</Typography>
        <Typography variant="h6" gutterBottom></Typography>
        <img src={img2} className={classes.img} alt='Top Grossing Android apps'/>
        <img src={img3} className={classes.img} alt='Overview menu of app'/>
        <img src={img4} className={classes.img} alt='pass level 50 to unlock new dreamy content!'/>
        <img src={img5} className={classes.img} alt='notifications from apps'/>
        <img src={img6} className={classes.img} alt='messages menu: connect to facebook option'/>
        <img src={img7} className={classes.img} alt='Join an Alliance! Popup message'/>
        <img src={img8} className={classes.img} alt='Join an Alliance! another popup message from different game'/>
        <img src={img9} className={classes.img} alt='Top in-app purchases with Extra Moves leading'/>
        <img src={img10} className={classes.img} alt='Top in-app purchases with Pile of GEms leading'/>
        <img src={img11} className={classes.img} alt='Top in-app purchases with Fistful of Gems leading'/>
        <img src={img12} className={classes.img} alt='Top in-app purchases with 28000 gold leading'/>
        <img src={img13} className={classes.img} alt='Top in-app purchases with 1200 gold leading'/>
        <img src={img14} className={classes.img} alt='Top in-app purchases with Spotify premium leading'/>
        <img src={img15} className={classes.img} alt='Top in-app purchases with pandora Once leading'/>
        <img src={img16} className={classes.img} alt='Top in-app purchases with Tidal Premium leading'/>
    </div>
  )
}

export default withStyles(jssStyle, {withTheme: true})(ImprovingYourAppTodaysTopEarningAppCharacteristics)
